import React from 'react';
import { gql, useQuery } from '@apollo/client';

/*
  GraphQL
*/
const GET_SUBMISSIONS = gql`
  query getAllSubmissions{
    submissions {
      _id
      score
      strength
      weakness
    }
  }
`;

/*
  Component
*/
export default function Admin(){
  const [getAllSubmissions] = useQuery(GET_SUBMISSIONS);

  return(
    <div>
      {
        getAllSubmissions()
        .then((data) => {
          console.log(data);
        })
      }
    </div>
  );
};
